import { Container, Menu, Grid, Icon, Label } from 'semantic-ui-react';

export default function MenuWeb() {
    return (
        <div className="menu">
            <Container>
                <Grid>
                    <Grid.Column className="menu__left" width={6}>
                        <MenuPlatforms />
                    </Grid.Column>
                    <Grid.Column className="menu__right" width={6}>
                        <h2>Menu Usuarios</h2>
                    </Grid.Column>
                </Grid>
            </Container>

        </div>
    )
}


function MenuPlatforms() {
    return (
        <Menu>
            <Menu.Item>
                PlayStation
            </Menu.Item>
        </Menu>
    )
}
